description:
Looking for all concrete service that are marked with annotation 'Injectable'. It fills a pool with any instances that can reuse in the application.


To use this library, you must perform following steps: 

1) MARK THE INJACTEBLE SERVICE
example: 

public interface IServiceA{ 
  string GetName(); 
} 

[Injectable] 
public class ConcreteServiceA : IServiceA{ 
    public string GetName(){ 
          return "Antonio"; 
    } 
} 

N.B. Only one interface service must be marked with the "Injectable" annotation 

2) START TO SEARCH THE INJACTABLE SERVICES

InjectManager.Search() 

N.B. If you would create all instance of service, you will use this method InjectManager.Search(true) 
N.B. Use this method one time in your application! 

3) LET'S INJECT YOUR SERVICE! 

public class ServiceController{ 

    private IServiceA service = InjectManager.Inject<IServiceA>(); 

    ..... 

}

A container used to host non-Orleans Microdot service which uses Ninject
for	dependency injection. Incoming HTTP calls (via Gigya.Microdot.ServiceProxy)
are dispatched to a specified class instance. Part of the Microdot framework.
